export class FeeTransaction {
  constructor(id, date, transactionId, eventProductOrder, eventServiceMapOrder, event, organizationReservation, entries, user) {
    this.id = id;
    this.date = date;
    this.transactionId = transactionId;
    this.eventProductOrder = eventProductOrder;
    this.eventServiceMapOrder = eventServiceMapOrder;
    this.event = event;
    this.organizationReservation = organizationReservation;
    this.entries = entries;
    this.user = user;
  }
}
export function getFeeTransactionIdentifier(feeTransaction) {
  return feeTransaction.id;
}
